import React, { useState } from "react"
import styles from "./MenuLink.module.css"
const MenuLink = ({ name, to, hover }) => {
  const [createMenuHidden, setCreateMenuHidden] = useState(true)
  const onHover = () => {
    setCreateMenuHidden(!createMenuHidden)
  }
  return (
    <div>
      <div onMouseEnter={hover} onMouseOut={hover} className={styles.link}>
        {name}
      </div>
      {createMenuHidden ? null : <div>{<CreateMenu></CreateMenu>}</div>}
    </div>
  )
}
export default MenuLink
